import React, { useState, useEffect } from 'react';
import { Card, CardContent } from '@/components/ui/card';
import { Button } from '@/components/ui/button';
import { Heart, Share } from 'lucide-react';

const App = () => {
  const [posts, setPosts] = useState([]);

  useEffect(() => {
    const fetchRSSFeeds = async () => {
      try {
        const response = await fetch('/api/rss'); // Replace with your backend RSS API endpoint
        const data = await response.json();
        setPosts(data.posts);
      } catch (error) {
        console.error('Failed to fetch RSS feeds:', error);
      }
    };

    fetchRSSFeeds();
  }, []);

  const handleLike = (index) => {
    const updatedPosts = [...posts];
    updatedPosts[index].likes = (updatedPosts[index].likes || 0) + 1;
    setPosts(updatedPosts);
  };

  const handleShare = (url) => {
    navigator.share({
      title: 'Check this out!',
      url,
    }).catch((error) => console.error('Error sharing:', error));
  };

  return (
    <div className="min-h-screen bg-gray-100 p-4">
      <header className="text-center mb-6">
        <h1 className="text-2xl font-bold">Trending Content</h1>
        <p className="text-sm text-gray-600">Stay updated with the latest memes, news, and trends!</p>
      </header>

      <div className="grid gap-4">
        {posts.map((post, index) => (
          <Card key={index} className="bg-white shadow-lg rounded-lg overflow-hidden">
            <CardContent>
              <h2 className="text-lg font-semibold mb-2">{post.title}</h2>
              <p className="text-sm text-gray-700 mb-4">{post.description}</p>
              <img
                src={post.image}
                alt={post.title}
                className="w-full rounded-lg mb-4"
              />
              <div className="flex justify-between items-center">
                <Button onClick={() => handleLike(index)} className="flex items-center space-x-1">
                  <Heart className="w-4 h-4" />
                  <span>{post.likes || 0}</span>
                </Button>
                <Button onClick={() => handleShare(post.link)} className="flex items-center space-x-1">
                  <Share className="w-4 h-4" />
                  <span>Share</span>
                </Button>
              </div>
            </CardContent>
          </Card>
        ))}
      </div>
    </div>
  );
};

export default App;
